import React, { useEffect, useState } from 'react';
import { useParams, Link } from 'react-router-dom';
import Footer from '../components/Footer';

const ProjectDetails = () => {
  const [isVisible, setIsVisible] = useState({});
  const { projectId } = useParams();

  useEffect(() => {
    const observerOptions = {
      threshold: 0.1,
      rootMargin: '0px 0px -50px 0px'
    };

    const observer = new IntersectionObserver((entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          setIsVisible(prev => ({
            ...prev,
            [entry.target.id]: true
          }));
        }
      });
    }, observerOptions);

    setTimeout(() => {
      const elements = document.querySelectorAll('[data-animate]');
      elements.forEach(el => observer.observe(el));
    }, 100);

    return () => observer.disconnect();
  }, []);

  const styles = {
    pageContainer: {
      minHeight: '100vh',
      fontFamily: "'Inter', system-ui, sans-serif"
    },
    heroSection: {
      background: 'linear-gradient(135deg, #1e293b 0%, #0f172a 100%)',
      padding: '120px 0 80px',
      color: 'white',
      position: 'relative',
      overflow: 'hidden'
    },
    heroContainer: {
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '0 24px',
      position: 'relative',
      zIndex: 2
    },
    heroImage: {
      width: '100%',
      height: '400px',
      objectFit: 'cover',
      borderRadius: '24px',
      marginTop: '40px',
      boxShadow: '0 25px 50px -12px rgba(0, 0, 0, 0.5)'
    },
    section: {
      padding: '100px 0',
      background: 'white'
    },
    container: {
      maxWidth: '1200px',
      margin: '0 auto',
      padding: '0 24px'
    },
    title: {
      fontSize: '3.5rem',
      fontWeight: '800',
      marginBottom: '24px',
      background: 'linear-gradient(135deg, #ffffff 0%, #cbd5e1 100%)',
      WebkitBackgroundClip: 'text',
      WebkitTextFillColor: 'transparent',
      backgroundClip: 'text'
    },
    description: {
      fontSize: '1.25rem',
      color: '#cbd5e1',
      maxWidth: '800px',
      lineHeight: '1.8',
      marginBottom: '40px'
    },
    featuresGrid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
      gap: '40px',
      marginTop: '80px'
    },
    featureCard: {
      background: 'rgba(255, 255, 255, 0.05)',
      borderRadius: '16px',
      padding: '32px',
      backdropFilter: 'blur(10px)',
      border: '1px solid rgba(255, 255, 255, 0.1)'
    },
    featureTitle: {
      fontSize: '1.5rem',
      fontWeight: '700',
      marginBottom: '16px',
      color: 'white'
    },
    featureDescription: {
      fontSize: '1.125rem',
      color: '#cbd5e1',
      lineHeight: '1.6'
    },
    statsSection: {
      background: 'linear-gradient(135deg, #f8fafc 0%, #f1f5f9 100%)',
      padding: '80px 0'
    },
    statsGrid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
      gap: '40px',
      textAlign: 'center'
    },
    statValue: {
      fontSize: '2.5rem',
      fontWeight: '800',
      color: '#1e293b',
      marginBottom: '8px'
    },
    statLabel: {
      fontSize: '1.125rem',
      color: '#64748b'
    },
    ctaSection: {
      textAlign: 'center',
      padding: '100px 0'
    },
    ctaTitle: {
      fontSize: '2.5rem',
      fontWeight: '800',
      color: '#1e293b',
      marginBottom: '24px'
    },
    ctaDescription: {
      fontSize: '1.25rem',
      color: '#64748b',
      maxWidth: '600px',
      margin: '0 auto 40px',
      lineHeight: '1.6'
    },
    ctaButton: {
      display: 'inline-block',
      background: 'linear-gradient(135deg, #6366f1, #8b5cf6)',
      color: 'white',
      padding: '16px 32px',
      borderRadius: '12px',
      fontSize: '1.125rem',
      fontWeight: '600',
      textDecoration: 'none',
      transition: 'all 0.3s ease',
      border: 'none',
      cursor: 'pointer',
      marginRight: '16px'
    },
    secondaryButton: {
      display: 'inline-block',
      background: 'white',
      color: '#6366f1',
      padding: '16px 32px',
      borderRadius: '12px',
      fontSize: '1.125rem',
      fontWeight: '600',
      textDecoration: 'none',
      transition: 'all 0.3s ease',
      border: '2px solid #6366f1',
      cursor: 'pointer'
    }
  };

  // Add CSS animations
  useEffect(() => {
    const style = document.createElement('style');
    style.textContent = `
      [data-animate] {
        opacity: 0;
        transform: translateY(30px);
        transition: all 0.8s ease-out;
      }
      
      [data-animate].visible {
        opacity: 1;
        transform: translateY(0);
      }
    `;
    document.head.appendChild(style);
  }, []);

  const eventifyData = {
    title: "Eventify",
    description: "Eventify is our event discovery and booking platform, designed to connect users with clubs, house parties, and venues in a seamless way.",
    image: "https://cdn.pixabay.com/photo/2017/07/21/23/57/concert-2527495_1280.jpg",
    features: [
      {
        title: "Discover events nearby",
        description: "Find the best events, clubs, and venues in your area with our intelligent discovery system."
      },
      {
        title: "Easy booking and RSVP",
        description: "Simple and intuitive booking process with instant confirmation and RSVP management."
      },
      {
        title: "Integration with clubs & venues",
        description: "Seamless integration with partner venues and clubs for real-time availability and bookings."
      },
      {
        title: "Simple user-friendly interface",
        description: "Clean, modern interface designed for the best user experience across all devices."
      }
    ],
    stats: [
      { value: "1,250+", label: "Venues" },
      { value: "3,400+", label: "Events" },
      { value: "4.8★", label: "Rating" }
    ],
    liveUrl: "https://eventify-demo.trinix.com"
  };

  return (
    <div style={styles.pageContainer}>
      {/* Hero Section */}
      <section style={styles.heroSection}>
        <div style={styles.heroContainer}>
          <h1 style={styles.title} data-animate id="title">
            {eventifyData.title}
          </h1>
          <p style={styles.description} data-animate id="description">
            {eventifyData.description}
          </p>
          <img
            src={eventifyData.image}
            alt={eventifyData.title}
            style={styles.heroImage}
            data-animate
            id="hero-image"
          />
        </div>
      </section>

      {/* Features Section */}
      <section style={styles.heroSection}>
        <div style={styles.container}>
          <div style={styles.featuresGrid}>
            {eventifyData.features.map((feature, index) => (
              <div
                key={index}
                style={styles.featureCard}
                data-animate
                id={`feature-${index}`}
                className={isVisible[`feature-${index}`] ? 'visible' : ''}
              >
                <h3 style={styles.featureTitle}>{feature.title}</h3>
                <p style={styles.featureDescription}>{feature.description}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Stats Section */}
      <section style={styles.statsSection}>
        <div style={styles.container}>
          <div style={styles.statsGrid}>
            {eventifyData.stats.map((stat, index) => (
              <div
                key={index}
                data-animate
                id={`stat-${index}`}
                className={isVisible[`stat-${index}`] ? 'visible' : ''}
              >
                <div style={styles.statValue}>{stat.value}</div>
                <div style={styles.statLabel}>{stat.label}</div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section style={styles.ctaSection}>
        <div style={styles.container}>
          <h2 style={styles.ctaTitle} data-animate id="cta-title">
            Ready to Get Started?
          </h2>
          <p style={styles.ctaDescription} data-animate id="cta-description">
            Join the thousands of users who are already discovering amazing events and venues through Eventify. Start your journey today!
          </p>
          <div data-animate id="cta-buttons">
            <a
              href={eventifyData.liveUrl}
              target="_blank"
              rel="noopener noreferrer"
              style={styles.ctaButton}
              onMouseEnter={(e) => {
                e.target.style.transform = 'translateY(-2px)';
                e.target.style.boxShadow = '0 8px 25px -5px rgba(99, 102, 241, 0.4)';
              }}
              onMouseLeave={(e) => {
                e.target.style.transform = 'translateY(0)';
                e.target.style.boxShadow = 'none';
              }}
            >
              Visit Live Project
            </a>
            <Link
              to="/projects"
              style={styles.secondaryButton}
              onMouseEnter={(e) => {
                e.target.style.background = '#6366f1';
                e.target.style.color = 'white';
              }}
              onMouseLeave={(e) => {
                e.target.style.background = 'white';
                e.target.style.color = '#6366f1';
              }}
            >
              Back to Projects
            </Link>
          </div>
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default ProjectDetails;
